config.script:
if self.props.selected:
    self.view.custom.ShowInstructions = True
else:
    self.view.custom.ShowInstructions = False

selectedRowData = self.parent.parent.parent.getChild("Row2/ProductCodes").props.selection.data
modalName = "editProductCode"
modalPath = "App/Schedule/ProductCodes/Embedded/Popups/Edit/EditProductCode"

params = {
	"ModalName": modalName,
	"RowData": selectedRowData
}

errorParams = {
	"ModalName": "ErrorModal",
	"ErrorMessage": "Please select a row first!"
}

if len(selectedRowData) > 0:
	system.perspective.openPopup(modalName, modalPath, params, title="Edit Product Code", modal=True)
else:
	system.perspective.openPopup("ErrorModal", "GlobalComponents/Modals/ErrorModal", errorParams, modal=True)

queryPath = 'app/Schedule/deletedProductCode'
pcID = self.view.custom.RowData[0].ID

params = { 'id': pcID }

try:
	system.db.runNamedQuery(queryPath, params)
	self.view.refreshBinding('custom.Data')
except Exception as e:
	errorParams = {
		"ModalName": "ErrorModal",
		"ErrorMessage": "The request could not be completed! " + str(e) 
	}

	system.perspective.openPopup("ErrorModal", "GlobalComponents/Modals/ErrorModal", errorParams)

logger = system.util.getLogger('productcodes_import')

try:
	params = { 'Type': 'productcodes' }
	system.perspective.openPopup("ImportFile", "GlobalComponents/Modals/ImportFile", params)

except Exception as e:
	errorParams = {
		"ModalName": "ErrorModal",
		"ErrorMessage": 'There was an error: ' + str(e)
	}

	msg = 'There was an error: ' + str(e)
	system.perspective.openPopup("ErrorModal", "GlobalComponents/Modals/ErrorModal", errorParams)

logger = system.util.getLogger('attribute_export')

try:
	data = self.parent.parent.parent.getChild("Row2/ProductCodes").props.data
	csv = system.dataset.toCSV(dataset = data, showHeaders = True, forExport = True)
	fileName = "ProductCodes.csv"

	system.perspective.download(fileName, csv)

except Exception as e:
	errorParams = {
		"ModalName": "ErrorModal",
		"ErrorMessage": 'There was an error: ' + str(e)
	}

	msg = 'There was an error: ' + str(e)
	system.perspective.openPopup("ErrorModal", "GlobalComponents/Modals/ErrorModal", errorParams)
